  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Rice Lake and Mille Lacs NWRs for the next 15
  years. This plan outlines the refuges' vision and purpose and describes how Rice
  Lake and Mille Lacs NWRs will contribute to the overall mission of the Refuge System.
  The plan provides an introduction to the refuges, an overview of the CCP process,
  information about the environment, current management programs, and strategies for
  implementation. Key planning issues include: habitat management, cultural resources,
  public use, common tern management, and wildlife management.\",\n\t\"license_title\":
